  {course_id: 1, title: "Address It!", description: "Use what you've learned to script your own letter and envelope, then upload a photo of the envelope. Envelopes can be a source of various challenges, variables, and opportunities — and they are typically at the core of a calligrapher's work. whether or not you select your own words or rewrite something you find instpirational,  you will have an attractive piece of writing at the end. This fun project is a excellent way to spend time with words you enjoy while improving your penmanship skills.", deliverable: "Use your new calligraphy skills address an envalope, and upload it here.", materials: "calligraphy nibs, pen holder, ink, and paper (your choice)", resources: nil},
  {course_id: 5, title: "Galaxy Watercolor", description: "Your assignment is to paint a fun, galaxy or nebula watercolor painting making use of techniques you learned during this course. Take a look at the attached photo examples or find your favourite space photo, or create something completely unique! The best paintings are a joy to make. Have fun this course, relax, and experiment in creating this project.", deliverable: "Upload your completed watercolor galaxy and a blurb about the process. Tell us about how you experimented!", materials: nil, resources: nil},
