Review.create!([
  {body: "Great class that inspired me to create and keep practicing! Thank you sooo much!", user_id: 8, course_id: 1},
  {body: "Excellent introduction! Thorough without being dull.", user_id: 15, course_id: 1},
  {body: "It's well explained and does a good job teaching all the basics.", user_id: 6, course_id: 1},
  {body: "It's my first time trying pointed pen calligraphy and this class really helped me.", user_id: 9, course_id: 1},
  {body: "A nice intro into Caligraphy. This makes the art seem very achievable for all! I look forward to designing calligraphy with my favorite quotes", user_id: 13, course_id: 2},
  {body: "Highly Recommended! I have wanted to take a calligraphy class forever and am very glad this is where I started.", user_id: 1, course_id: 2},
  {body: "This class explains everything you need to know to get started with attractive hand lettering. Very detailed and clear explanations.", user_id: 4, course_id: 2},
  {body: "This course does a great job introducing you to the beginning steps of learning modern calligraphy!", user_id: 10, course_id: 2},
  {body: "Great techniques and great instructors. Everything is explained very well with demostrations.", user_id: 9, course_id: 2},
  {body: "I learned so much! This was a really great class. Highly recommended.", user_id: 3, course_id: 4},
  {body: "Excellent beginners tutorial. Scarlett is a great teacher -  I love her style. So many great tips and ideas on how to become a better watercolorist!", user_id: 9, course_id: 4},
  {body: "Great instruction! Very detailed and clear explanations, with answers to all my questions before they even popped into my head!", user_id: 7, course_id: 4},
  {body: "I wholeheartedly recommend this class.  As long as you're not too ambitious in your project, you will have something really cool at the end.", user_id: 2, course_id: 4},
  {body: "The videos for this class are extremely helpful.  I watched it once through before even picking up my tools, just to understand the process and visualize.", user_id: 12, course_id: 4},
  {body: "This is a very beginner friendly course! I've really enjoyed the lessons so far :)", user_id: 1, course_id: 5},
  {body: "This is a great beginners watercolors class! Loved how simple it was, how clear. I think I'll be returning to the class and the exercises many times as I start my watercolor practice.", user_id: 10, course_id: 5},
  {body: "As an aspiring artist, I wholeheartedly recommend this class. The course materials are awesome and the lessons are great fun.", user_id: 5, course_id: 5},
  {body: "Excellent beginners tutorial. I really learned so much from this class. By the end of the course you really feel comfortable with your own work.", user_id: 13, course_id: 5},
  {body: "This class is useful and inspiring and provides a lot of helpful tips for someone who is a beginner like me! Thank you.", user_id: 8, course_id: 3},
  {body: "Awesome class and instructor, picked up lots of great tips. Wonderful talent!", user_id: 5, course_id: 3},
  {body: "I love to create and design, and art journaling is such a fun way to boost your creativity! This was a very cool class with lots of usefull information", user_id: 2, course_id: 3},
  {body: "Another high quality set of tutorials. Highly recommended! I'm looking forward to applying these techniques in my own art journals.", user_id: 14, course_id: 3},
  {body: "Really good class. Good place to start if you are a lost begginer. Excellent teacher, very organized, well prepared.", user_id: 4, course_id: 7},
  {body: "Very very informative! Thorough without being dull. Wish I had taken this course months ago!", user_id: 5, course_id: 7},
  {body: "Perfectly accessible for a complete newbie. Thank you so much, I will definitely try the project! :)", user_id: 12, course_id: 7},
  {body: "Easy to follow instructions in pretty short and clear very useful videos. Fantastic class !", user_id: 14, course_id: 7},
  {body: " Very good explanations of how things work, easy to follow, and great examples. I will be going through all these lessons again very soon.", user_id: 1, course_id: 7},
  {body: "This class is very technical, academic and detailed. Good for beginners and for those wishing to refresh on their basic skills. ", user_id: 3, course_id: 8},
  {body: "This class really breaks down the tips I needed to work on key elements in such a quick and easy way.  Would recommend it it to anyone wants to learn drawing professionally.", user_id: 11, course_id: 8},
  {body: "Simple and effective lecturing. I learned new techniques that I haven't tried before and it was fun to see how my work improved. ", user_id: 6, course_id: 8},
  {body: "An excellent class on realistic pencil drawing .  Everything flowed and made sense, and was really well explained. ", user_id: 12, course_id: 8},
  {body: "Great Class! Loved it! After this class my drawing improved quite dramatically.", user_id: 13, course_id: 6},
  {body: "Fantastic techniques, clear guidelines. Observing these artists' work has made my own charcoal portraits so much better.", user_id: 4, course_id: 6},
  {body: "Great advice for those who are new to drawing and very inspiring for experience artists. Just brilliant!", user_id: 15, course_id: 6},
  {body: "Well researched class with good coverage of the basics of light/shade and foundational techniques. I had so many aha moments throughout this course.", user_id: 9, course_id: 6},
  {body: "This is the best online drawing course I have taken! Definitely worth watching if you're wanting to improve your charcoal skills.", user_id: 8, course_id: 6}
